/** @jsx jsx */
/** @jsxRuntime classic */
import { css, jsx } from "@emotion/core";
import navLogo from "../../navLogo.svg";


const HeroNavLogo = () => <a href="/"> <img css={styles} src={navLogo} /> </a>

const styles = css`
    margin-right: 140px;
    user-select: none;

`;

export default HeroNavLogo;
